import React from "react";
import "./leader.css";

const Sentence = {
  hidden: {
    opacity: 1,
  },
  visibile: {
    opacity: 1,
    transition: {
      delay: 0.5,
      staggerChildren: 0.08,
    },
  },
};

const Letter = {
  hidden: {
    opacity: 0,
    y: 50,
  },
  visibile: {
    opacity: 1,
    y: 0,
  },
};
class Leader extends React.Component {
  render() {
    const industry = "IT Staffing";

    return (
      <section className="leaderSection">
        <div className="container">
          <div className="title">
            <span>We Are A Leader In </span>
            <motion.span
              variant={Sentence}
              initial="hidden"
              animate="visible"
              className="industryName"
            >
              {industry.split("").map((char, index))}
            </motion.span>
          </div>

          <div className="sub-text">
            BrainHR IT Solutions provides services that improve the way business
            is done in the world.
          </div>
        </div>
      </section>
    );
  }
}
export default Leader;
